import React from 'react';

function Home() {

    return (

            <div class="jumbotron">
                <h1 class="display-4">Google Books</h1>
                <p class="lead">Google Books React Web Application to Search Books from Google Books API.It does operations from google book api that searches the full text of books and magazines that Google has scanned, converted to text using optical character recognition, and stored in its digital database.Books are provided either by publishers and authors through the Google Books Partner Program, or by Google's library partners through the Library Project.Additionally, Google has partnered with a number of magazine publishers to digitize their archives.</p>
                <hr class="my-4" />
                <p class='lead'>A book is a medium for recording information in the form of writing or images, typically composed of many pages (made of papyrus, parchment, vellum, or paper) bound together and protected by a cover.[1] The technical term for this physical arrangement is codex (plural, codices). In the history of hand-held physical supports for extended written compositions or records, the codex replaces its immediate predecessor, the scroll. A single sheet in a codex is a leaf, and each side of a leaf is a page.</p>
            </div>

    );
}

export default Home;
